import React, {Component} from 'react';
import './Home.css';
import logo from '../pics/logo.png';
import background from '../pics/background.png';

class Home extends Component {
  render() {
    return (
      <div className="body"> 
        <div className="top">
          <div className="title">
            <span>DA</span> 
            <img src={logo} id="logo"/>
            <span>LC</span>
          </div>
          <div className="nav-bar">
            <a className="link">JOIN THE CLUB</a>
            <a className="link">MINT</a>
            <a className="link">APES</a>
            <a className="link">ROADMAP</a>
            <a className="link">TEAM</a>
          </div>
        </div>
        <img src={background} id="background"/>
        <div className="text">
          <div className="welcome body-text">
            <h1>Welcome to the Degen Ape Lambo Club</h1>
            <p>DALC is a collection of 2,000 Degenerate Apes, created to unite degen traders from across the NFT community. Your Degen Ape doubles as your membership card to the OpenSea Bets Discord group, a community driven hub for discussing NFT alpha, degen plays, great wins, and equally great losses. Additionally, each Degen Ape serves as a guaranteed whitelist for any NFTs created by our artist. </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
